import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import PersonalDetails from '../PersonalDetail/PersonalDetails';
import HomeDetails from '../PersonalDetail/HomeDetails';

function TotalInfo() {
  return (
      <Router>
        <nav>
          <Link to="/Sigin/property/TotalInfo//personalDetails" style={{ display: 'block' }}>Personal Details</Link>
          <Link to="/Sigin/property/TotalInfo//homeDetails" style={{ display: 'block' }}>Home Details</Link>
        </nav>

        <Routes>
          <Route path="/Sigin/property/TotalInfo/personalDetails" element={<PersonalDetails />} />
          <Route path="/Sigin/property/TotalInfo/homeDetails" element={<HomeDetails />} />
        </Routes>
      </Router>
  );
}

export default TotalInfo;
